import { connect } from "react-redux"
import Card from "../Card/Card"

export const Favorites = ({myFavorites}) => {
return (
    <div>
        {
        myFavorites?.map(fav => {
            <Card
            key={fav.id}
            id={fav.id}
            name={fav.name}
            species={fav.species}
            gender={fav.gender}
            image={fav.image}
            />
        })
        }
    </div>
);
}

const MapStateToProps = (state) => {
    return {
        myFavorites: state.myFavorites
    }
}

export default connect(
    MapStateToProps,
    null,
)(Favorites)
